contract JSFLOR is IERC20 {
    string public name = "JSFLOR";
    string public symbol = "JSF";
    uint public decimals = 0;
    uint public override totalSupply;

    address public founder;

    mapping(address => uint) public balances;

    mapping(address => mapping(address => uint)) public allowed;

    constructor() {
        totalSupply = 1000000;
        founder = msg.sender;
        balances[founder] = totalSupply;
    }

    function balanceOf(address account) external view override returns (uint256) {
        return balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        require(balances[msg.sender] >= amount);

        balances[recipient] += amount;
        balances[msg.sender] -= amount;

        emit Transfer(msg.sender, recipient, amount);

        return true;
    }

    function allowance(address owner, address spender) external view override returns (uint256) {
        return allowed[owner][spender];
    }

    function approve(address spender, uint256 amount) external override returns (bool) {
        require(balances[msg.sender] >= amount);
        require(amount > 0);

        allowed[msg.sender][spender] = amount;

        emit Approval(msg.sender, spender, amount);

        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        require(allowed[sender][recipient] >= amount);
        require(balances[sender] >= amount);

        balances[sender] -= amount;
        balances[recipient] += amount;
        allowed[sender][recipient] -= amount;

        return true;
    }
}

contract JSFLOR_ICO is JSFLOR {
    address public admin;
    address payable public deposit;
    uint public tokenPrice = 0.001 ether; // 1ETH = 1000MCT, 1MCT = 0.001ETH
    uint public hardCap = 300 ether;
    uint public raisedAmount;
    uint public saleStart = block.timestamp; // Will start when deployed
    uint public saleEnd = block.timestamp + 31536000; // ICO ends in one year
    uint public tokenTradeStart = saleEnd + 604800; // transferable in a week after sales end
    uint public maxInvestment = 5 ether;
    uint public minInvestment = 0.1 ether;

    enum State {BeforeStart, Running, AfterEnd, Halted}
    State public icoState;

    constructor(address payable _deposit) {
      deposit = _deposit;
      admin = msg.sender;
      icoState = State.BeforeStart;
    }

    receive() payable external {
      invest();
    }

    modifier onlyAdmin() {
      require(msg.sender == admin);
      _;
    }

    event Invest(address investor, uint value, uint tokens);

    function halt() public onlyAdmin {
      icoState = State.Halted;
    }

    function resume() public onlyAdmin {
      icoState = State.Running;
    }

    function changeDepositAddress(address payable newDeposit) public onlyAdmin {
      deposit = newDeposit;
    }

    function getCurrentState() public view returns (State) {
      if (icoState == State.Halted) {
        return State.Halted;
      } else if (block.timestamp < saleStart) {
        return State.BeforeStart;
      } else if (block.timestamp >= saleStart && block.timestamp <= saleEnd) {
        return State.Running;
      } else {
        return State.AfterEnd;
      }
    }

    function invest() public payable returns (bool) {
      icoState = getCurrentState();
      require(icoState == State.Running);
      require(msg.value >= minInvestment && msg.value <= maxInvestment);

      raisedAmount += msg.value;
      require(raisedAmount <= hardCap);

      uint tokens = msg.value / tokenPrice;

      balances[msg.sender] += tokens;
      balances[founder] -= tokens;
      deposit.transfer(msg.value);

      emit Invest(msg.sender, msg.value, tokens);

      return true;
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
      require(block.timestamp > tokenTradeStart);
      super.transfer(recipient, amount); // same as JSFLOR.transfer(recipient, amount);
      return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
      require(block.timestamp > tokenTradeStart);
      super.transferFrom(sender, recipient, amount); // same as JSFLOR.transferFrom(sender, recipient, amount);
      return true;
    }

    function burn() public returns (bool) {
      icoState = getCurrentState();
      require(icoState == State.AfterEnd);
      balances[founder] = 0;
      return true;
    }
}

